import Head from "next/head";
import { useState } from "react";
import { ChakraProvider, Box, Center, Button } from "@chakra-ui/react";
import Link from "next/link";
import Layout from "../components/Layout";

function App() {
	const [count, setCount] = useState(0);

	const handleIncrement = () => {
		setCount(() => count + 1);
	};
	const handleDecrement = () => {
		setCount(() => count - 1);
	};
	return (
		<ChakraProvider>
			<Layout>
				<Head>
					<title>Next Practice</title>
				</Head>

				<Center p={4}>
					<Box bg="black" w="100%" p={4} color="red.500">
						{count}
						<Button m="4" p="2" onClick={handleIncrement}>
							+
						</Button>
						<Button onClick={handleDecrement}>-</Button>
					</Box>
				</Center>
				<Link href="/about">
					<a>About </a>
				</Link>
				<Link href="/home">
					<a>Home</a>
				</Link>
				<Link href="/contact/[id]">
					<a>Contact</a>
				</Link>
			</Layout>
		</ChakraProvider>
	);
}
export default App;
